import React from "react";
import { useParams } from "react-router-dom";

import PlaceList from "../components/PlaceList";

const DUMMY_PLACES = [
  {
    id: "p1",
    title: "SVNIT- surat",
    description: "One of the reputed NIT's in surat",
    imageUrl:
      "https://static.toiimg.com/thumb/msid-68192064,width-1070,height-580,imgsize-126695,resizemode-75,overlay-toi_sw,pt-32,y_pad-40/photo.jpg",
    address: "chchhanath Surat- Dumas, Road, Keval Chowk, Surat",
    location: {
      lat: 21.1640345,
      long: 72.7782708,
    },
    creator: "u1",
  },
  {
    id: "p2",
    title: "SVNIT- surat",
    description: "One of the reputed NIT's in surat",
    imageUrl:
      "https://static.toiimg.com/thumb/msid-68192064,width-1070,height-580,imgsize-126695,resizemode-75,overlay-toi_sw,pt-32,y_pad-40/photo.jpg",
    address: "chchhanath Surat- Dumas, Road, Keval Chowk, Surat",
    location: {
      lat: 21.1640345,
      long: 72.7782708,
    },
    creator: "u2",
  },
];

const UserPlaces = () => {
  const userId = useParams().userId;
  const loadedPlaces = DUMMY_PLACES.filter(
    (places) => places.creator == userId
  );
  return <PlaceList items={loadedPlaces} />;
};

export default UserPlaces;
